var trsDiffVentas = new Array;
        
//Function get (it gets data from other web)
//url--> url of the web
//func--> function to do with the received data

try{
	//Try to assign GM_xmlhttpRequest to get function (firefox and emulated greasemonkey). It can do cross domain!
	get = function(url, func) {
	  GM_xmlhttpRequest({
		method: "GET",
		 url: url,
		 onload: function(xhr) { func(xhr.responseText); }
	  });
	}
}
catch( ex ){
	//If we cant with GM_xmlhttpRequest, assign general request (it cant do cross domain...)
	get = function(url, func) {
		var xhr = new XMLHttpRequest();
		xhr.open("GET", url, true);
		xhr.send();
		xhr.onreadystatechange = function() {
		  if (xhr.readyState == 4) {
			func(xhr.responseText);
		  }
		}
	}
}


try{
	//Try to assign GM_xmlhttpRequest to get function (firefox and emulated greasemonkey). It can do cross domain!
	getSync = function(url, func) {
	  GM_xmlhttpRequest({
		method: "GET",
		 url: url,
		 onload: function(xhr) { func(xhr.responseText); },
		 synchronous: true
	  });
	}
}
catch( ex ){
	//If we cant with GM_xmlhttpRequest, assign general request (it cant do cross domain...)
	getSync = function(url, func) {
		var xhr = new XMLHttpRequest();
		xhr.open("GET", url, false);
		xhr.send();
		xhr.onreadystatechange = function() {
		  if (xhr.readyState == 4) {
			func(xhr.responseText);
		  }
		}
	}
}


//////////////////////////// FUNCION PARA TRAER LOS JUGADORES COMPRADOS Y VER DIFERENCIA DE PRECIO ACTUAL  ////////////////////


function getJugadoresComprados(text) 
{
    var pujaspos = text.indexOf("Tus pujas:");
    var table1pos = text.indexOf("tableline01", pujaspos);
    var table2pos = text.indexOf("<table", table1pos);

    var tablaPujasHTML = text.substring(table2pos, text.indexOf("</table", table2pos));

    var tabla = document.createElement("table");
    
    tabla.innerHTML = tablaPujasHTML;
    
    trsPujas = tabla.getElementsByTagName("tr");

    for (var i = 0; i < trsPujas.length; i++) 
    {
        var tdsPujas = trsPujas[i].getElementsByTagName("td");
        
        if (tdsPujas[tdsPujas.length - 1].innerHTML == "Efectuada") 
        {
			trsDiffVentas.push(trsPujas[i]);
        }
    }

    if (text.indexOf('title="Siguiente"', pujaspos) != -1) {
        var botonSiguientePujasPos = text.indexOf('title="Siguiente"', pujaspos);
        var link = "";				
        var hrefSiguientePujaPos = text.lastIndexOf('href=', botonSiguientePujasPos) + 'href="'.length;
        var hrefSiguientePujaPosFin = text.indexOf('"', hrefSiguientePujaPos);
        var hrefSiguientePuja = text.substring(hrefSiguientePujaPos, hrefSiguientePujaPosFin);
                
        hrefSiguientePuja = replaceAll(hrefSiguientePuja, "&amp;", "&");
        
        var comunio = "http://www.comuniogp.com/";
        
        link = comunio + hrefSiguientePuja;

        get( link, getJugadoresComprados );
    } else {
        
        if (window.location.href.indexOf( "putOnExchangemarket" ) != -1) 
	    { 
	        
	        var tblVentas = document.getElementById("table");
            var trsVentas = tblVentas.getElementsByTagName("tr");
            patronNombre = /Nombre/;
            	                        
            for ( var a = 0; a < trsVentas.length; a++ )
            {
            
                var tdsVentas = trsVentas[a].getElementsByTagName("td");
                
                nombreVenta = tdsVentas[1].textContent;
                precioVenta = tdsVentas[3].textContent;
                
                tdDiferencia = trsVentas[a].appendChild(document.createElement("td"));
                tdCompra = trsVentas[a].appendChild(document.createElement("td"));
                
                trsVentas[a].insertBefore(tdCompra,trsVentas[a].childNodes[4]);
                trsVentas[a].insertBefore(tdDiferencia,trsVentas[a].childNodes[5]);
                
                tdCompra.align = "center";
                tdDiferencia.align = "center";
                
                if ( !patronNombre.test(nombreVenta) )
                { 
                    
                    var puntostext = tdsVentas[6].textContent;
                    puntostext = replaceAll(puntostext, "+", "");
                    var puntos =  parseInt(puntostext);
							    
				    if (puntos == 0) {
					    
					    tdsVentas[6].style.color = "BLUE";
					    
				    } else if (puntos > 0) {
					    
					    tdsVentas[6].style.color = "GREEN";
					    
				    } else if (puntos < 0) {
				    
				        tdsVentas[6].style.color = "RED";
                    
                    }
                    
		            for ( var x = 0; x < trsDiffVentas.length; x++ )   
	                {
	                    
	                    var tdsCompras = trsDiffVentas[x].getElementsByTagName("td");
	                    
                        nombreCompra = tdsCompras[0].textContent;
                        
                        if(nombreCompra == nombreVenta)
                        {                    
	                    
	                        if(tdsCompras[6].innerHTML == "Efectuada")
	                        {

	                            precioCompra = tdsCompras[3].textContent;
	                            
	                            precioCompra = replaceAll(precioCompra, ".", "");
							    precioVenta = replaceAll(precioVenta, ".", "");
							    
							    var diferencia =  parseInt(precioVenta) - parseInt(precioCompra);
							    
							    if (diferencia > 0) {
								    tdsVentas[5].style.color = "GREEN";
							    } else if (diferencia < 0) {
								    tdsVentas[5].style.color = "RED";
							    }
							    
							    diferencia = formateaNumero(diferencia, ".", true);
	                            precioCompra = formateaNumero(precioCompra, ".", true);
	                            precioCompra = replaceAll(precioCompra, "+", "");
	                            	                            
	                            tdsVentas[4].innerHTML = precioCompra;
	                            tdsVentas[5].innerHTML = diferencia;
	                            
	                            break;   
	                        }
	                    
	                    }	                    
	                    
	                }
	                
	            } else {
	            
	                tdCompra.innerHTML = '<a href="javascript:void(0)">Precio de Compra</a>';
                    tdDiferencia.innerHTML = '<a href="javascript:void(0)">Diferencia de Valor</a>';
	            
	            }
                
              
               
                
                
	        }    
	    }
    }
}
		        
function formateaNumero(numero, separador_miles, mostrarPositivos) {
    
    numero = parseInt(numero);
    if(isNaN(numero)){
        return "";
    }
    
    if (mostrarPositivos && numero <= 0) {
    	mostrarPositivos = false;
    }

    if(separador_miles){
    	numero = numero.toString();
        // Añadimos los separadores de miles
        var miles=new RegExp("(-?[0-9]+)([0-9]{3})");
        while(miles.test(numero)) {
            numero=numero.replace(miles, "$1" + separador_miles + "$2");
        }
    }
    
    if (mostrarPositivos) {
    	numero = "+" + numero;
    }

    return numero;
}

